import React from 'react';
import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import frame3 from '../assets/frame3.png';
import frame1 from '../assets/frame1.png';
import frame2 from '../assets/frame2.png';

function ECommerceSection() {
    // Array of card content
    const cards = [
        {
            title: "Card Title 1",
            text: "Some quick example text to build on the card title and make up the bulk of the card's content.",
            buttonText: "Go somewhere 1",
            image: frame3,
        },
        {
            title: "Card Title 2",
            text: "Some quick example text to build on the card title and make up the bulk of the card's content.",
            buttonText: "Go somewhere 2",
            image: frame2,
        },
        {
            title: "Card Title 3",
            text: "Some quick example text to build on the card title and make up the bulk of the card's content.",
            buttonText: "Go somewhere 3",
            image: frame1,
        }
    ];

    return (
        <Container>
            <h6 className="px-0 mx-2 display-6 fw-bolder underline w-max mb-3">Shop</h6>
            <p className="lead mt-3 mb-4 px-0">
                Below you can find a selection of the many services I offer, feel free to contact me about any of them by pressing the related button.
            </p>
            <div className='row no-gutters'>
                {cards.map((card, index) => (
                    <div key={index} className='col-12 col-md-4'>
                        <Card>
                            <Card.Img variant="top" src={card.image} />
                            <Card.Body>
                                <Card.Title>{card.title}</Card.Title>
                                <Card.Text>
                                    {card.text}
                                </Card.Text>
                                <Button variant="primary">{card.buttonText}</Button>
                            </Card.Body>
                        </Card>
                    </div>
                ))}
            </div>
        </Container>
    );
}

export default ECommerceSection;
